  Kay was educated at Patutahi School, Dilworth School, Auckland, and Gisborne
  High School. He started work about 1946 with the Ministry of Works in
  Wellington as an engineering cadet and in 1950 he returned to work on the
  family farm before going to Australia in 1952. There he worked in Moss Vale, NSW, initially on a dairy
  farm and then in the cement works. In 1955 he returned from Australia, working briefly for a local
  builder before working once again on the family property. He took over management of the farm in 1956
  following his father's death, finally purchasing the property in 1962. After his father's death he
  sold off the dairy cows to concentrate on pig breeding and cropping, which he continued to pursue until
  semi-retirement in 1983, when he sold off the pigs. He was a member of the Pork Industry Council
  (1969-82) and was chairman for six years. During the period 1950-60 he won many awards in the Pork and
  Bacon Competitions at both local and national levels.
  Kay was a keen sportsman and represented Poverty Bay at both cricket and soccer, finally retiring from
  competitive club soccer just before his 40th birthday. In his later years he was a cricket umpire for
  the Poverty Bay Cricket Association. He was also a member of the Patutahi School Committee and at the
  time of his death was also on the committee of Te Wiremu House Retirement Home.
  Janet was educated at Ormond Primary School and Te Karaka District High School and briefly at Napier
